create table technologies (
	id BIGSERIAL NOT NULL,
	github_id VARCHAR(50) NOT NULL PRIMARY KEY,
	javascript INT NOT NULL,
	html INT NOT NULL,
	css INT NOT NULL,
	node INT NOT NULL,
	python INT NOT NULL,
	react INT NOT NULL,
	svelete INT NOT NULL,
	postgres INT NOT NULL,
	dynamo_db INT NOT NULL,
	tensorflow INT NOT NULL
);
